#include <bits/stdc++.h>
using namespace std;

struct TestCase {
	vector<int> arr;
	int ans = 0;
};

ostream& operator << (ostream& out, TestCase testcase)
{
	out << "{{";
	for (int i = 0; i < testcase.arr.size(); i++)
		cout << (i == 0 ? "" : ", ") << testcase.arr[i];
	out << "}, " << testcase.ans << "}";
	return out;
}

int solve(vector<int> arr)
{
	sort(arr.begin(), arr.end());
	int n = (int)arr.size();
	int i = n / 2 - 1, j = n - 1, ans = 0;
	while (i >= 0 && j >= n / 2)
	{
		if (arr[i] * 2 < arr[j])
		{
			i--;
			j--;
			ans++;
		}
		else
		{
			i--;
		}
	}
	return ans;
}

void runRandom()
{
	srand((unsigned)time(0));

	while (true)
	{
		TestCase testcase;
		int n = rand() % 50 + 1;
		for (int i = 0; i < n; i += 2)
		{
			int j = rand() % 50 + 1;
			testcase.arr.push_back(j);
			testcase.arr.push_back(j * 2 + 1);
			testcase.ans++;
		}
		if (rand() % 2 == 1)
			testcase.arr.push_back(rand() % 50 + 1);
		sort(testcase.arr.begin(), testcase.arr.end());

		cout << testcase << ",\n";

		assert(solve(testcase.arr) == testcase.ans);
	}
}

